Method.Source:
        /// <summary>
    /// find.
    /// </summary>
    /// <param name="_forupdate">
    /// The new value of the forupdate; optional.
    /// </param>
    /// <returns>
    /// The current value of ITVTRentalParameters.
    /// </returns>
    static ITVTRentalParameters find(boolean _forupdate = false)
    {
        ITVTRentalParameters parameters;

        if (_forupdate)
        {
            parameters.selectForUpdate(_forupdate);
        }

        select firstonly parameters
            index KeyIdx
            where parameters.Key == 0;

        if (!parameters && !parameters.isTmp())
        {
            Company::createParameter(parameters);
        }

        return parameters;
    }

/// <summary>
/// validate data
/// </summary>
/// <returns>Boolean</returns>
public boolean validateWrite()
{
    boolean ret;

    ret = super();

    if(this.FactorPercentage > 100 || this.FactorPercentage < 0.01)
    {
        ret = checkFailed("@ITVTRental:RentalFactorError");
    }
    return ret;
}

    public static ITVTInventDimValueDefault getInventDimDefaultValue(TableId _tableNum)
    {
        ITVTInventDimValueDefault   defaultValue;
        ITVTRentalParameters        itvtRentalParameters = ITVTRentalParameters::find();

        switch(_tableNum)
        {
            case tableNum(PurchLine):           defaultValue = itvtRentalParameters.InventDimValueDefaultPurch;   break;
            case tableNum(ProdTable):           defaultValue = itvtRentalParameters.InventDimValueDefaultProd;    break;
            case tableNum(SalesLine):           defaultValue = itvtRentalParameters.InventDimValueDefaultSales;   break;
            case tableNum(ITVTRentalLine):      defaultValue = itvtRentalParameters.InventDimValueDefaultRental;  break;
        }

        return defaultValue;
    }

public static InventDim setRentalInventDimDefault(InventDim _inventDimOri, TableId _tableNum)
{
    return ITVTRentalParameters::setRentalInventDimStatus(_inventDimOri, ITVTRentalParameters::getInventDimDefaultValue(_tableNum));
}

    public static InventDim setRentalInventDimStatus(InventDim _inventDimOri, ITVTInventDimValueDefault _value = ITVTRentalParameters::find().InventDimValueStatusNew)
    {
        ITVTRentalParameters itvtRentalParameters = ITVTRentalParameters::find();

        if (itvtRentalParameters.InventDimension == ITVTInventDimension::None)
        {
            return _inventDimOri;
        }

        InventDim                   inventDim;

        inventDim.clear();
        inventDim.initFromInventDim(_inventDimOri);

        switch(itvtRentalParameters.InventDimension)
        {
            case ITVTInventDimension::InventConfigId:       inventDim.configId              = _value; break;
            case ITVTInventDimension::InventSizeId:         inventDim.InventSizeId          = _value; break;
            case ITVTInventDimension::InventColorId:        inventDim.InventColorId         = _value; break;
            case ITVTInventDimension::InventStyleId:        inventDim.InventStyleId         = _value; break;
            case ITVTInventDimension::InventVersionId:      inventDim.InventVersionId       = _value; break;
            case ITVTInventDimension::InventSiteId:         inventDim.InventSiteId          = _value; break;
            case ITVTInventDimension::InventLocationId:     inventDim.InventLocationId      = _value; break;
            case ITVTInventDimension::wmsLocationId:        inventDim.wmsLocationId         = _value; break;
            case ITVTInventDimension::wMSPalletId:          inventDim.wmsPalletId           = _value; break;
            case ITVTInventDimension::LicensePlateId:       inventDim.LicensePlateId        = _value; break;
            case ITVTInventDimension::InventStatusId:       inventDim.InventStatusId        = _value; break;
            case ITVTInventDimension::InventBatchId:        inventDim.InventBatchId         = _value; break;
            case ITVTInventDimension::InventSerialId:       inventDim.InventSerialId        = _value; break;
            case ITVTInventDimension::SHA1HashHex:          inventDim.SHA1HashHex           = _value; break;
            case ITVTInventDimension::InventGtdId_RU:       inventDim.InventGtdId_RU        = _value; break;
            case ITVTInventDimension::InventOwnerId_RU:     inventDim.InventOwnerId_RU      = _value; break;
            case ITVTInventDimension::InventProfileId_RU:   inventDim.InventProfileId_RU    = _value; break;
            case ITVTInventDimension::InventDimension1:     inventDim.InventDimension1      = _value; break;
            case ITVTInventDimension::InventDimension2:     inventDim.InventDimension2      = _value; break;
            case ITVTInventDimension::InventDimension3:     inventDim.InventDimension3      = _value; break;
            case ITVTInventDimension::InventDimension4:     inventDim.InventDimension4      = _value; break;
            case ITVTInventDimension::InventDimension5:     inventDim.InventDimension5      = _value; break;
            case ITVTInventDimension::InventDimension6:     inventDim.InventDimension6      = _value; break;
            case ITVTInventDimension::InventDimension7:     inventDim.InventDimension7      = _value; break;
            case ITVTInventDimension::InventDimension8:     inventDim.InventDimension8      = _value; break;
            //TODO: Proper conversion??? -->
            case ITVTInventDimension::InventDimension9:     inventDim.InventDimension9      = str2Date(_value,123); break;
            case ITVTInventDimension::InventDimension10:    inventDim.InventDimension10     = str2num(_value);      break;
            //TODO: Proper conversion??? <--
            case ITVTInventDimension::InventDimension11:    inventDim.InventDimension11     = _value; break;
            case ITVTInventDimension::InventDimension12:    inventDim.InventDimension12     = _value; break;
        }

        return InventDim::findOrCreate(inventDim);
    }

    public static str getRentalInventDimStatus(InventDim _inventDim)
    {
        str ret;

        ITVTRentalParameters itvtRentalParameters = ITVTRentalParameters::find();

        if (itvtRentalParameters.InventDimension == ITVTInventDimension::None)
        {
            return '';
        }

        switch (itvtRentalParameters.InventDimension)
        {
            case ITVTInventDimension::InventConfigId:      ret = _inventDim.configId;           break;
            case ITVTInventDimension::InventSizeId:        ret = _inventDim.InventSizeId;       break;
            case ITVTInventDimension::InventColorId:       ret = _inventDim.InventColorId;      break;
            case ITVTInventDimension::InventStyleId:       ret = _inventDim.InventStyleId;      break;
            case ITVTInventDimension::InventVersionId:     ret = _inventDim.InventVersionId;    break;
            case ITVTInventDimension::InventSiteId:        ret = _inventDim.InventSiteId;       break;
            case ITVTInventDimension::InventLocationId:    ret = _inventDim.InventLocationId;   break;
            case ITVTInventDimension::wmsLocationId:       ret = _inventDim.wmsLocationId;      break;
            case ITVTInventDimension::wMSPalletId:         ret = _inventDim.wmsPalletId;        break;
            case ITVTInventDimension::LicensePlateId:      ret = _inventDim.LicensePlateId;     break;
            case ITVTInventDimension::InventStatusId:      ret = _inventDim.InventStatusId;     break;
            case ITVTInventDimension::InventBatchId:       ret = _inventDim.InventBatchId;      break;
            case ITVTInventDimension::InventSerialId:      ret = _inventDim.InventSerialId;     break;
            case ITVTInventDimension::SHA1HashHex:         ret = _inventDim.SHA1HashHex;        break;
            case ITVTInventDimension::InventGtdId_RU:      ret = _inventDim.InventGtdId_RU;     break;
            case ITVTInventDimension::InventOwnerId_RU:    ret = _inventDim.InventOwnerId_RU;   break;
            case ITVTInventDimension::InventProfileId_RU:  ret = _inventDim.InventProfileId_RU; break;
            case ITVTInventDimension::InventDimension1:    ret = _inventDim.InventDimension1;   break;
            case ITVTInventDimension::InventDimension2:    ret = _inventDim.InventDimension2;   break;
            case ITVTInventDimension::InventDimension3:    ret = _inventDim.InventDimension3;   break;
            case ITVTInventDimension::InventDimension4:    ret = _inventDim.InventDimension4;   break;
            case ITVTInventDimension::InventDimension5:    ret = _inventDim.InventDimension5;   break;
            case ITVTInventDimension::InventDimension6:    ret = _inventDim.InventDimension6;   break;
            case ITVTInventDimension::InventDimension7:    ret = _inventDim.InventDimension7;   break;
            case ITVTInventDimension::InventDimension8:    ret = _inventDim.InventDimension8;   break;
            case ITVTInventDimension::InventDimension9:    
                ret = date2Str(
                    _inventDim.InventDimension9,
                    123, 
                    DateDay::Auto, 
                    DateSeparator::Auto, 
                    DateMonth::Auto, 
                    DateSeparator::Auto, 
                    DateYear::Auto);
                break;
            case ITVTInventDimension::InventDimension10:   
                ret = num2Str(
                    _inventDim.InventDimension10, 
                    -1, 
                    -1, 
                    DecimalSeparator::Auto, 
                    ThousandSeparator::Auto);      
                break;
            case ITVTInventDimension::InventDimension11:   ret = _inventDim.InventDimension11;  break;
            case ITVTInventDimension::InventDimension12:   ret = _inventDim.InventDimension12;  break;
        }

        return ret;
    }

