    /// <summary>
    /// Checks whether Rental dimension is active for the Item
    /// </summary>
    /// <param name = "_itemId">Item for which active dimensions are checked</param>
    /// <returns>true if Rental dimension is active for Item, otherwise false</returns>
    public static boolean rentalInventDimFieldActiveForItem(ItemId _itemId)
    {
        ITVTRentalParameters itvtRentalParameters = ITVTRentalParameters::find();

        if (itvtRentalParameters.InventDimension == ITVTInventDimension::None)
        {
            return false;
        }

        boolean ret; 

        InventDimParm inventDimParm = InventDimParm::activeDimFlag(InventDimGroupSetup::newItemId(_itemId));

        switch (itvtRentalParameters.InventDimension)
        {
            case ITVTInventDimension::InventConfigId:      ret = inventDimParm.ConfigIdFlag;           break;
            case ITVTInventDimension::InventSizeId:        ret = inventDimParm.InventSizeIdFlag;       break;
            case ITVTInventDimension::InventColorId:       ret = inventDimParm.InventColorIdFlag;      break;
            case ITVTInventDimension::InventStyleId:       ret = inventDimParm.InventStyleIdFlag;      break;
            case ITVTInventDimension::InventVersionId:     ret = inventDimParm.InventVersionIdFlag;    break;
            case ITVTInventDimension::InventSiteId:        ret = inventDimParm.InventSiteIdFlag;       break;
            case ITVTInventDimension::InventLocationId:    ret = inventDimParm.InventLocationIdFlag;   break;
            case ITVTInventDimension::wmsLocationId:       ret = inventDimParm.wmsLocationIdFlag;      break;
            case ITVTInventDimension::wMSPalletId:         ret = inventDimParm.wmsPalletIdFlag;        break;
            case ITVTInventDimension::LicensePlateId:      ret = inventDimParm.LicensePlateFlag;       break;
            case ITVTInventDimension::InventStatusId:      ret = inventDimParm.InventStatusFlag;       break;
            case ITVTInventDimension::InventBatchId:       ret = inventDimParm.InventBatchIdFlag;      break;
            case ITVTInventDimension::InventSerialId:      ret = inventDimParm.InventSerialIdFlag;     break;
