static boolean exist()
{
    return (select firstonly RecId from ITVTRentalParameters).RecId != 0;
}

    public static ITVTRentalParameters findByCompany(DataAreaId _company, boolean _forUpdate = false)
    {
        ITVTRentalParameters parameter;

        changecompany(_company)
        {
            parameter = ITVTRentalParameters::find(_forUpdate);
        }

        return parameter;
    }

    static date dateStartWk(date transDate)
    {
        #TimeConstants

        WeekDays weekStart = ITVTRentalParameters::find().ITVTWeekStart;

        if (weekStart)
        {
            int dayOfWeek = dayOfWk(transdate);
            int daysToSubtract = (dayOfWeek >= weekStart) ? (dayOfWeek - weekStart) : (dayOfWeek + #daysPerWeek - weekStart);
            return transDate - daysToSubtract;
        }
        else
        {
            return dateStartWk(transDate);
        }
    }

    static date  dateEndWk(date transDate)
    {
        #TimeConstants
        WeekDays weekStart = ITVTRentalParameters::find().ITVTWeekStart;

        if (weekStart)
        {
            int dayOfWeek = dayOfWk(transdate);
            int daysToAdd = (weekStart > dayOfWeek) ? (weekStart - dayOfWeek - 1) : (#daysPerWeek - dayOfWeek + weekStart - 1);
            return transDate + daysToAdd;
        }
        else 
        {
            return dateEndWk(transDate);
        }
    }
